携帯電話等のストラップ用の金具　5本入りです。ビーズやキャラクター・飾り物などを簡単につけることができるので、ストラップやキーホルダー作りに最適です。<br>２重丸カンが付いています。 .<br><br>◆色：ホワイト（白）×シルバー<br>◆サイズ：長さ約5.7cm（丸カン含む）<br>◆素材：真鍮・ポリエステル<br>◆内容：1袋5本入り<br><br>※写真の色は実物と多少異なる場合があります。<style type="text/css">
